import React, { Component } from 'react';
import { connect } from 'react-redux';



class ArtPage extends Component {
    // Renders the entire app on the DOM


    render() {
      console.log('this is a clear page with clear objectives');


        return (
           <div>
 <Typo className={this.props.classes.cardText} variant='body1'>Kingdom: {p.kingdom}</Typo>
                        <Typo className={this.props.classes.cardText} variant='body1'>Clade: {p.clade}</Typo>
                        <Typo className={this.props.classes.cardText} variant='body1'>Order: {p.order}</Typo>
                        <Typo className={this.props.classes.cardText} variant='body1'>Family: {p.family}</Typo>
                        <Typo className={this.props.classes.cardText} variant='body1'>Subfamily: {p.subfamily}</Typo>
                        <Typo className={this.props.classes.cardText} variant='body1'>Genus: {p.genus}</Typo>
           </div>
        );
    }
}

const mapReduxStateToProps = (reduxState) => {
    return reduxState;
}


export default connect(mapReduxStateToProps)(ArtPage);
